const PromotionsPage = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold mb-4">프로모션</h1>
      <div className="space-y-4">
        <p>진행중인 프로모션 내용이 들어갑니다.</p>
      </div>
    </div>
  );
};

export default PromotionsPage;
